import React, { useEffect, useState } from 'react';
import './Schedules.css';

const Schedules = () => {
    const [schedules, setSchedules] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const [formData, setFormData] = useState({
        name: '',
        cronExpression: '',
        url: '',
        method: 'GET'
    });

    const cronPatterns = [
        { label: 'Selecione um padrão...', value: '' },
        { label: 'A cada minuto', value: '* * * * *' },
        { label: 'A cada 5 minutos', value: '*/5 * * * *' },
        { label: 'A cada 15 minutos', value: '*/15 * * * *' },
        { label: 'A cada 30 minutos', value: '*/30 * * * *' },
        { label: 'A cada hora', value: '0 * * * *' },
        { label: 'Todo dia à meia-noite', value: '0 0 * * *' },
        { label: 'Todo domingo à meia-noite', value: '0 0 * * 0' },
        { label: 'Todo mês dia 1 à meia-noite', value: '0 0 1 * *' }
    ];

    useEffect(() => {
        fetchSchedules();
    }, []);

    const fetchSchedules = async () => {
        try {
            const response = await fetch('http://localhost:5000/api/schedules');
            const data = await response.json();
            setSchedules(data);
            setLoading(false);
        } catch (error) {
            console.error('Erro ao buscar agendamentos:', error);
            setError(error.message);
            setLoading(false);
        }
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await fetch('http://localhost:5000/api/schedules', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify(formData),
            });

            if (!response.ok) {
                throw new Error('Erro ao criar agendamento');
            }

            await fetchSchedules();
            setFormData({
                name: '',
                cronExpression: '',
                url: '',
                method: 'GET'
            });
        } catch (err) {
            setError(err.message);
        }
    };

    const handleDelete = async (id) => {
        try {
            const response = await fetch(`http://localhost:5000/api/schedules/${id}`, {
                method: 'DELETE',
            });

            if (!response.ok) {
                throw new Error('Erro ao excluir agendamento');
            }

            await fetchSchedules();
        } catch (err) {
            setError(err.message);
        }
    };

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData(prev => ({
            ...prev,
            [name]: value
        }));
    };

    const handleCronPatternChange = (e) => {
        const selectedPattern = e.target.value;
        setFormData(prev => ({
            ...prev,
            cronExpression: selectedPattern
        }));
    };

    if (loading) {
        return <div className="schedules">Carregando...</div>;
    }

    if (error) {
        return <div className="schedules">Erro: {error}</div>;
    }

    return (
        <div className="schedules">
            <h2>Novo Agendamento</h2>
            <form onSubmit={handleSubmit} className="schedule-form">
                <div className="form-group">
                    <label htmlFor="name">Nome:</label>
                    <input
                        type="text"
                        id="name"
                        name="name"
                        value={formData.name}
                        onChange={handleInputChange}
                        required
                    />
                </div>

                <div className="form-group">
                    <label htmlFor="cronPattern">Padrão de Agendamento:</label>
                    <select
                        id="cronPattern"
                        value={formData.cronExpression}
                        onChange={handleCronPatternChange}
                        className="cron-pattern-select"
                    >
                        {cronPatterns.map((pattern, index) => (
                            <option key={index} value={pattern.value}>
                                {pattern.label}
                            </option>
                        ))}
                    </select>
                </div>

                <div className="form-group">
                    <label htmlFor="cronExpression">Expressão Cron:</label>
                    <input
                        type="text"
                        id="cronExpression"
                        name="cronExpression"
                        value={formData.cronExpression}
                        onChange={handleInputChange}
                        required
                        placeholder="*/5 * * * *"
                    />
                    <small>Exemplo: */5 * * * * (a cada 5 minutos)</small>
                </div>

                <div className="form-group">
                    <label htmlFor="url">URL:</label>
                    <input
                        type="url"
                        id="url"
                        name="url"
                        value={formData.url}
                        onChange={handleInputChange}
                        required
                        placeholder="https://api.exemplo.com"
                    />
                </div>

                <div className="form-group">
                    <label htmlFor="method">Método:</label>
                    <select
                        id="method"
                        name="method"
                        value={formData.method}
                        onChange={handleInputChange}
                        required
                    >
                        <option value="GET">GET</option>
                        <option value="POST">POST</option>
                        <option value="PUT">PUT</option>
                        <option value="DELETE">DELETE</option>
                    </select>
                </div>

                <button type="submit" className="submit-btn">Criar Agendamento</button>
            </form>

            <h2>Agendamentos Existentes</h2>
            <div className="schedules-list">
                {schedules.length === 0 ? (
                    <p>Nenhum agendamento encontrado</p>
                ) : (
                    schedules.map((schedule) => (
                        <div key={schedule.id} className="schedule-item">
                            <h3>{schedule.name}</h3>
                            <p>Expressão Cron: {schedule.cronExpression}</p>
                            <p>URL: {schedule.url}</p>
                            <p>Método: {schedule.method}</p>
                            <button
                                onClick={() => handleDelete(schedule.id)}
                                className="delete-btn"
                            >
                                Excluir
                            </button>
                        </div>
                    ))
                )}
            </div>
        </div>
    );
};

export default Schedules;
